import React, { useState, useEffect } from 'react';
import { useUser } from "../contexts/user.context";
import { Button, Card, CardContent, Typography } from '@mui/material';
import '../static/Home.Page.css'; // Import CSS file

export default function Home() {
  const { logOutUser } = useUser();

  const logOut = async () => {
    try {
      const loggedOut = await logOutUser();
      if (loggedOut) {
        window.location.reload(true);
      }
    } catch (error) {
      alert(error);
    }
  };

  const UserList = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
      const fetchUsers = async () => {
        try {
          const response = await fetch('/api/users'); // Ensure this matches your server's route
          if (!response.ok) throw new Error('Failed to fetch');
          const data = await response.json();
          setUsers(data);
        } catch (error) {
          console.error("Error fetching users:", error);
        }
      };

      fetchUsers();
    }, []);

    return (
      <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}> {/* Changed to column layout */}
        {users.map(user => (
          <Card key={user._id} style={{ minWidth: '300px' }}> {/* Adjust minWidth as needed */}
            <CardContent>
              <Typography variant="h5" component="div">
                {user.username}
              </Typography>
              <Typography variant="body2">
                Email: {user.email}
              </Typography>
            </CardContent>
          </Card>
        ))}
      </div>
    );
  };

  const Navbar = () => {
    return (
      <nav className="navbar">
        <div className="navbar-left">
          <a href="#">Main Project</a>
        </div>
        <div className="navbar-right">
          <a className="Signup" href="/Signup">Signup</a>
          <a className="Logout" href="/Login">Logout</a>

        </div>
      </nav>
    );
  };

  return (
    <>
      <div className="main-page">
        <Navbar />
        <UserList />
      </div>
    </>
  );
}
